import { Routes,Route } from "react-router-dom";
import UserNavbar from "./13userNavbar";
import UserDashBoard from "./14userDashBoard";

const userHome = () => {
    return ( 
        <div className="userHome">
            <UserNavbar/>
            <Routes>
                <Route path="/" element={<UserDashBoard/>}/>
                <Route path="/" element={<UserDashBoard/>}/>
            </Routes>
        </div>
     );
}
 
export default userHome;
